window.bookSummaryJSON = "<p><b>After centuries alone, he's finally found a place to belong...in her.</b></p> <p>Ezo is an alien who's crazy about all things Earth. He can’t wait to get there in person and experience it all for himself - pizza, chocolate, flirting. After a lifetime of being alone on his old planet, he’ll finally have a place he can call home.</p> <p>But when he arrives, a mate has already been chosen for him. Ana is waiting as soon as he exits his shuttle. She’s beautiful, colorful, and seems as excited to meet him as he is her.</p> <p>He’s never known such happiness. Everything is perfect...until it’s not. Because, Ezo isn’t a free man. He has a mission to accomplish. One that his entire race is depending on. But accomplishing his mission could mean having to leave his beautiful Ana behind.</p>"; 
